import './Main.css';
import Profile from "./Profile/Profile";
import Nav from "./Nav/Nav";
import Dialogs from "./Dialogs/Dialogs";
import {Route} from "react-router-dom";

const Main = () => {
	return (
		<main className='main'>
			<Nav />
			<div className="main__body">
				<Route component={Profile} />
				<Route component={Dialogs} />
			</div>
		</main>
	)
}

export default Main;
